import React, { Component } from 'react'
import styled from 'styled-components'

// Components
import FullScreen from '../fullscreen'

// Images
import background from './background.jpg'

const ProfileWrapper = styled(FullScreen)`
  background: linear-gradient(rgba(0, 0, 0, 0.7), rgba(0, 0, 0, 0.7)),
    url(${background});
  background-size: cover;
  color: white;
  width: 70%;
  display: inline-block;
  vertical-align: top;
`

const ProfileContainer = styled.div`
  width: intrinsic;
  padding: 20px;
  position: relative;
`
const ProfileBorder = styled.div`
  &:before {
    content: '';
    position: absolute;
    width: 50%;
    height: calc(100% - 30px);
    bottom: 0;
    left: 0;
    border-bottom: 3px solid white;
    border-left: 3px solid white;
  }

  &:after {
    content: '';
    position: absolute;
    width: 50%;
    height: calc(100% - 30px);
    top: 0;
    right: 0;
    border-top: 3px solid white;
    border-right: 3px solid white;
  }
`

const ProfileTitle = styled.h1`
  font-family: 'Julius Sans One', sans-serif;
  font-size: 3.5rem;
  margin: 0 0 10px;
`

const ProfileDetail = styled.p`
  font-size: 0.9rem;
  letter-spacing: 3px;
  margin: 0;
  opacity: 0.6;
  margin-left: 5px;
`

const ExperinceWrapper = styled(FullScreen)`
  width: 30%;
  display: inline-block;
  vertical-align: top;
`

class Profile extends Component {
  render() {
    return (
      <React.Fragment>
        <ProfileWrapper>
          <ProfileContainer>
            <ProfileBorder />
            <ProfileTitle>PUNN</ProfileTitle>
            <ProfileDetail>Punchaya Siriphanthong</ProfileDetail>
            <ProfileDetail>26 December 1996 | 22 years old</ProfileDetail>
            <ProfileDetail>p.siriphanthong@gmail.com</ProfileDetail>
          </ProfileContainer>
        </ProfileWrapper>
        <ExperinceWrapper>
          <p>Assumption Collect Ubonratchathani</p>
          <p>King's Mongkut University</p>
        </ExperinceWrapper>
      </React.Fragment>
    )
  }
}

export default Profile
